import { BrowserRouter, Routes, Route, Switch } from 'react-router-dom';
import { Footer } from '../Footer';
import CustomerPurchaseCoupon from './CustomerPurchaseCoupon';
import GetCustomerCoupons from './GetCustomerCoupons';
import GetCustomerCouponsByCategory from './GetCustomerCouponsByCategory';
import GetCustomerCouponsByMaxPrice from './GetCustomerCouponsByMaxPrice';
import GetCustomerDetails from './GetCustomerDetails';
import { NavBarCustomer } from './NavBarCustomer';

interface Props {
  token: string;
  id: number | undefined;
}

export const HomeCustomer = (props: Props) => {
  
  return (
    <div className="HomeAdmin">

      <BrowserRouter>
        <NavBarCustomer />
        <Switch>
          <Route exact path='/customer/coupons'>
            <GetCustomerCoupons token={props.token} id={props.id} />
          </Route>
          <Route exact path='/customer/coupons/category'>
            <GetCustomerCouponsByCategory token={props.token} id={props.id} />
          </Route>
          <Route exact path='/customer/coupons/maxPrice'>
            <GetCustomerCouponsByMaxPrice token={props.token} id={props.id} />
          </Route>
          <Route exact path='/customer/getDetails'>
            <GetCustomerDetails token={props.token} id={props.id} />
          </Route>
          <Route exact path='/customer/purchaseCoupon'>
            <CustomerPurchaseCoupon token={props.token} id={props.id} />
          </Route>
          <Route path='*'>
            <h1>404 Not Found</h1>
          </Route>
        </Switch>
      </BrowserRouter>

      <Footer />

    </div>
  )
}
